  false,\n\t\"url\": null,\n\t\"notes\": \"NOAA CoastWatch distributes near real time
  wind stress data in zonal, meridional, modulus, and wind stress curl sets.  This
  data begins with wind velocity measurements from the ASCAT instrument onboard EUMETSAT's
  METOP satellite.  ASCAT is a microwave scatterometer designed to measure surface
  winds over the global ocean.  NOAA CoastWatch processes wind velocity to wind stress
  and wind stress curl.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
